import React, {useState, useEffect} from 'react';
import Table from 'react-bootstrap/Table';
import UserService from '../user/services/user-services';
import {getProfessionalsResults} from '../user/services/user-services';
import _ from 'lodash';

const Ammattilaiset = () => {
    const[group, setGroup] = useState([]);
    const [results, setResults] = useState([]);
    useEffect (() =>{
        getProfessionalsResults().then(response => setResults(response));
    }, [])

    let personCount = 0; //suorittajalkm:n laskemiseksi
    const personCounter = () => {
        return personCount++;
    };
    
   
    let personArray = results.map(personCounter);
    console.log(personArray);

    
            console.log(personCount);
            var result1 = _(results)
                   .groupBy(x => x.date)
                   .map((value, key) => 
                   ({date: key,
                    results: _.sumBy(value,'times'),
                    users: value})).value();

                    console.log(result1);

    const professionalsResults = result1.map((result,index) => 
    <>
    <tr><td>{result.date}</td><td>{result.results}</td>
    <td>{personCount}</td></tr>
    </>
    );
    
    const pResults = (
        <>
        <thead>
        <tr>
        <th>Pvm</th>
        <th>Suoritukset yhteensä</th>
        <th>Suorittajalkm</th>
        </tr>
    </thead>
    <tbody>
        <tr>
            <td>Eka päivä</td>
            <td>{personCount}</td>
        </tr>
        {professionalsResults}
    </tbody>
    </>
    );
    
    return(
        <>
        <h2 style={{textAlign: "center"}}>Ammattilaiset</h2><br />
        <div id="table-div">
            <Table striped bordered hover size="sm">
             {pResults}
            </Table>
        </div>
        </>
    )
}
export default Ammattilaiset;
